import React from 'react';
import ReactDOM from 'react-dom';

import { AuthContextProvider } from './context/auth-context';

import './index.css';
import App from './App';

ReactDOM.render(
    <AuthContextProvider>
        <App />, 
        document.getElementById('root')
    </AuthContextProvider>
);
